import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter as Router,Routes, Route, Link } from "react-router-dom";
import Candels from './Candels'
import  Search  from "./Search";

function FetchSearch()

    {  var srch=[]
       const a=[1,2,23,4]
        var c=-1
        const [desc,setDes]=useState([])
        const [symbl,setSym]=useState([])
        const [sen,setSend]=useState([])
        var li=[]
        var lii=[]
        
        function fetch(e)
        {
          srch=e.target.value
          
        }
        
        function Inn()
        {
         
       
        axios
                .get(`https://finnhub.io/api/v1/search?q=${srch}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {   var con=0
               const {count}= response.data
               while(con<count){
                
                const {description,symbol}= response.data.result[con]
               
                li.push(symbol)
                lii.push(description)
                setDes(lii)
                setSym(li)
                con=con+1
                setSend(a[2])
               }
                
        })
    }
    ;
    srch=symbl[0]
    JSON.stringify(srch)
    console.log(typeof(srch))
        return(<>
        <Router>
        <input type="text" onChange={fetch}/>
        <button onClick={Inn}>Generate</button>
        <h1>{symbl[0]}</h1>
        {
            
           desc.map((x)=>{
            c=c+1
            {}
            <Link to="/search"> <h1 style={{color:"black",textDecoration:'none'}}>name:{x}, symbol:{symbl[c]}</h1></Link>
            
           })
            
  
            }
            </Router>
      <Routes>
      
          <Route path="candels" element={<Candels sy={desc[0]} />} />
          <Route path="search" element={<Search sy={li[0]}/>} />
      </Routes>
    <h1>{li}</h1>
       </>)
       
    }
    export default FetchSearch
